package toonly.mapper.test;

import com.fasterxml.jackson.core.JsonProcessingException;
import com.fasterxml.jackson.databind.ObjectMapper;
import com.fasterxml.jackson.databind.ObjectWriter;
import org.apache.http.HttpEntity;
import org.apache.http.HttpResponse;
import org.apache.http.NameValuePair;
import org.apache.http.client.HttpClient;
import org.apache.http.client.entity.UrlEncodedFormEntity;
import org.apache.http.client.methods.HttpGet;
import org.apache.http.client.methods.HttpPost;
import org.apache.http.client.methods.HttpPut;
import org.apache.http.client.methods.HttpUriRequest;
import org.apache.http.client.protocol.HttpClientContext;
import org.apache.http.entity.StringEntity;
import org.apache.http.impl.client.HttpClients;
import org.apache.http.impl.conn.PoolingHttpClientConnectionManager;
import org.apache.http.message.BasicHeader;
import org.apache.http.util.EntityUtils;
import org.junit.Test;

import java.io.IOException;
import java.io.UnsupportedEncodingException;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;
import java.util.function.Supplier;

/**
 * Created by caoyouxin on 15-2-25.
 */
public class MapperUnitTester {

    private final ObjectMapper objectMapper = new ObjectMapper();
    private final ObjectWriter objectWriter = objectMapper.writer();

    @Test
    public void putReqTest() {
        Map<String, Object> params = new HashMap<>();
        params.put("id", 1);
        params.put("name", "fucker");

        HttpPut httpPut = new HttpPut("http://localhost:8080/api/v1/entity/user?f=modify&un=test");
//        httpPut.addHeader(new BasicHeader("Authorization", "Bearer " + accessToken));
        httpPut.addHeader(new BasicHeader("Content-Type", "application/json"));
        try {
            httpPut.setEntity(new StringEntity(objectWriter.writeValueAsString(params), "UTF-8"));
        } catch (JsonProcessingException e) {
            e.printStackTrace();
        }

        this.reqTest(() -> httpPut);
    }

    @Test
    public void postReqTest() {
        Map<String, Object> params = new HashMap<>();
        params.put("__CSRFTOKEN", "wEFJDAxYmEyYmNiLTdjMzMtNDczZC04OTBlLTk4OWNmMjFjMDEzYg==");
        params.put("__EVENTTARGET", "MoreInfoList1$Pager");
        params.put("__EVENTARGUMENT", "2");
        params.put("__VIEWSTATE", "");

        HttpPost httpPost = new HttpPost("http://ggzy.jiangxi.gov.cn/jxzbw/zfcg/017002/017002001/MoreInfo.aspx?CategoryNum=017002001");
        httpPost.addHeader(new BasicHeader("Content-Type", "text/html"));

        List<NameValuePair> params2 = new ArrayList<>();
        params.forEach((key, value) -> params2.add(new NameValuePair() {
            @Override
            public String getName() {
                return key;
            }

            @Override
            public String getValue() {
                return value.toString();
            }
        }));
        try {
            httpPost.setEntity(new UrlEncodedFormEntity(params2));
        } catch (UnsupportedEncodingException e) {
            e.printStackTrace();
        }

        this.reqTest(() -> httpPost);
    }

    @Test
    public void getReqTest() {
        HttpGet httpGet = new HttpGet("http://localhost:8080/api/v1/entity/goods/select?un=test");
//        httpPost.addHeader(new BasicHeader("Authorization", "Bearer " + accessToken));

        this.reqTest(() -> httpGet);
    }

    private void reqTest(Supplier<HttpUriRequest> supplier) {
        PoolingHttpClientConnectionManager cm = new PoolingHttpClientConnectionManager();
        cm.setMaxTotal(20);
        cm.setDefaultMaxPerRoute(4);
        HttpClient httpClient = HttpClients.custom().setConnectionManager(cm).build();

        try {
            HttpResponse response = httpClient.execute(supplier.get(), HttpClientContext.create());
            Integer status = response.getStatusLine().getStatusCode();
            HttpEntity entity = response.getEntity();
            String content = entity != null ? EntityUtils.toString(entity) : null;
            System.out.println(String.format("status: [%d], content: [%s]", status, content));
        } catch (IOException e) {
            e.printStackTrace();
        }
    }

}
